import React from "react";
// import axios from 'axios';

const NormalStore = () =>{
  const fetchCurrentUserId = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/current-user-id', { 
        method:'GET',
        credentials:'include'

      });
      if (response.ok) {
        // Handle successful logout
        console.log(response.data.userId);
        // Optionally redirect to login page or clear authentication state
      } else {
        console.error('Logout failed');
      }
    } catch (error) {
      console.error('Error fetching current user ID:', error);
      
    }
  };


  


  return(
    <>
    <div>Hello</div>
    <button onClick={fetchCurrentUserId}>userId</button>
    </>
  )
}

export default NormalStore
